import React from 'react';
import './ContactUs.css';

const WeddingTypeForm = ({ formData, handleChange, setStep }) => {
  return (
    <div className="form-container">
      <h2>Wedding Type</h2>
      <form>
        <div className="form-group">
          <label htmlFor="weddingType">Type of Wedding:</label>
          <select
            id="weddingType"
            name="weddingType"
            value={formData.weddingType}
            onChange={handleChange}
            required
          >
            <option value="">Select Wedding Type</option>
            <option value="local">Local Wedding</option>
            <option value="national">National Destination Wedding</option>
            <option value="international">International Destination Wedding</option>
          </select>
        </div>

        {formData.weddingType === 'national' && (
          <div className="form-group">
            <label htmlFor="preferredDestination">Preferred National Destination:</label>
            <input
              type="text"
              id="preferredDestination"
              name="preferredDestination"
              value={formData.preferredDestination}
              onChange={handleChange}
              placeholder="e.g., Goa, Rajasthan, Kerala"
            />
          </div>
        )}

        {formData.weddingType === 'international' && (
          <div className="form-group">
            <label htmlFor="preferredInternationalDestination">Preferred International Destination:</label>
            <input
              type="text"
              id="preferredInternationalDestination"
              name="preferredInternationalDestination"
              value={formData.preferredInternationalDestination}
              onChange={handleChange}
              placeholder="e.g., Bali, Paris, Maldives"
            />
          </div>
        )}

        <div className="form-navigation">
          <button type="button" onClick={() => setStep(2)}>
            Previous
          </button>
          <button type="button" onClick={() => setStep(4)}>
            Next Step
          </button>
        </div>
      </form>
    </div>
  );
};

export default WeddingTypeForm;
